// SelectedDateComponent.js
import React from 'react';
import { format } from 'date-fns';
import { he } from 'date-fns/locale';

const SelectedDateComponent = ({ selectedDate, onBack }) => {
  return (
    <div>
      <h2>Selected Date</h2>
      <p>{format(selectedDate, 'MM/dyyyy', { locale: he })}</p>
      <button onClick={onBack}>Back</button>
      {/* Add additional content for the selected date component */}
    </div>
  );
};

export default SelectedDateComponent;
